objetoCompra:
Guarda-chuva.
Estrutura em alumínio ou superior;
Com abertura automática e fechamento automático ou manual;
Tecido impermeável;
Cabo antiaderente;
Opcional: possuir tecnologia reversa criativa (não pinga após fechado);
Cores escuras, preferencialmente preto;
Dimensões aproximadas: 120 a 155 cm após aberto.
